import React from "react";
import { NavLink } from "react-router-dom";

const SignedInLinks = () => {
  return (
    <div>
      <ul className="right">
        <li>
          <NavLink to="/" />korpa
        </li>
        <li>
          <NavLink to="/" />invitacije
        </li>
        <li>
          <NavLink to="/" />rezervacije
        </li>
        <li>
          <NavLink to="/" />prijatelji
        </li>
        <li>
          <NavLink to="/" />profil
        </li>
        <li>
          <NavLink to="/" />izloguj se
        </li>
      </ul>
    </div>
  );
};

export default SignedInLinks;
